window.bookSummaryJSON = "<p>In the 26th century, a female cyborg is rescued from the scrap heap by a scientist....</p> <p>This is the official audio novelization to the 2018 science-fiction film, <i>Alita: Battle Angel</i>, based on manga by Yukito Kishiro. The film is directed by Robert Rodriguez, written and produced by James Cameron of <i>Titanic</i> and <i>Avatar</i> fame, and stars Rosa Salazar, Christoph Waltz, Jennifer Connelly, Ed Skrein, Jackie Earle Haley, and Mahershala Ali.</p>"; 
